import React from 'react';

function Contact() {
  return (
    <div className="text-center mt-8">
      <h1 className="text-4xl font-bold text-blue-500">Contact Us</h1>
      <p className="mt-4">Get in touch with us through this page.</p>
    </div>
  );
}

export default Contact;
